-- Table structure for `yds_b2c_order`
-- ----------------------------
DROP TABLE IF EXISTS `yds_b2c_order`;
CREATE TABLE `yds_b2c_order` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '食材连订单表',
  `station_id` int(11) NOT NULL DEFAULT '0' COMMENT '所属水站id',
  `deliver_id` int(11) NOT NULL DEFAULT '0',
  `config_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '所属服务号ID',
  `openid` char(128) NOT NULL DEFAULT '' COMMENT '所属微信用户openid',
  `address_id` int(11) NOT NULL DEFAULT '0' COMMENT '订单地址ID',
  `order_sn` char(30) NOT NULL DEFAULT '' COMMENT '订单编号',
  `order_price` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '订单总金额',
  `order_original_price` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '订单原价',
  `comment` char(180) NOT NULL DEFAULT '' COMMENT '订单备注',
  `pay_type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '支付方式，0:线下支付，1:微信支付，2:水票支付，3水票和线下支付 4 水票和微信支付',
  `pay_status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '支付状态,0.未支付，1:支付成功，2:支付失败，3:退款中，4:已退款',
  `pay_id` int(11) NOT NULL DEFAULT '0' COMMENT '支付纪录ID',
  `order_status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '订单状态，0:下单成功，1:水站已接单，2:水工配送中，3:已送达，4:已取消，5:已关闭，6:等待支付',
  `create_time` char(19) NOT NULL DEFAULT '' COMMENT '下单时间',
  `deliver_accept_time` int(10) NOT NULL DEFAULT '0',
  `finish_time` int(10) NOT NULL DEFAULT '0',
  `pay_notify_time` int(10) NOT NULL DEFAULT '0',
  `bucket` int(10) NOT NULL DEFAULT '0' COMMENT '退桶数量',
  `type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0普通订单1退桶订单2组合商品订单',
  `ticket_id` int(11) DEFAULT '0' COMMENT '使用水票的id ',
  `deliver_type` tinyint(1) DEFAULT '0' COMMENT '0未派单1已派单',
  `ticket_num` int(11) DEFAULT '0' COMMENT '使用水票的个数',
  `send_code` int(11) DEFAULT '0' COMMENT '订单提交成功后的送达码',
  PRIMARY KEY (`id`),
  KEY `confgi_id_index` (`config_id`) USING BTREE,
  KEY `config_id_openid_index` (`config_id`,`openid`) USING BTREE,
  KEY `config_id_openid_order_status_index` (`config_id`,`openid`,`order_status`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='易点水b2c订单表';

-- ----------------------------
-- Records of yds_b2c_order
-- ----------------------------

