CREATE TABLE `yds_grade_detail` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `grade_name` varchar(32) NOT NULL,
  `credit_code` varchar(32) NOT NULL COMMENT '信用码',
  `abb` varchar(32) NOT NULL COMMENT '简称',
  `adress` varchar(32) NOT NULL COMMENT '地址',
  `contacts` varchar(32) NOT NULL COMMENT '联系人',
  `bussiness_img` varchar(255) NOT NULL COMMENT '营业执照',
  `grade_id` int(11) NOT NULL COMMENT '用户id',
  `create_time` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=24 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of yds_grade_detail
-- ----------------------------

-- ----------------------------
-- Table structure for `yds_grade_draw_reply`
-- ----------------------------
DROP TABLE IF EXISTS `yds_grade_draw_reply`;
CREATE TABLE `yds_grade_draw_reply` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `grade_id` int(10) NOT NULL,
  `money` float(10,2) DEFAULT NULL,
  `status` tinyint(1) NOT NULL COMMENT '状态0-未审核，1-审核通过，2-审核未通过',
  `create_time` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of yds_grade_draw_reply
-- ----------------------------

-- ----------------------------
-- Table structure for `yds_guestbook`
-- ----------------------------
DROP TABLE IF EXISTS `yds_guestbook`;
CREATE TABLE `yds_guestbook` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `full_name` varchar(50) NOT NULL COMMENT '留言者姓名',
  `email` varchar(100) NOT NULL COMMENT '留言者邮箱',
  `title` varchar(255) DEFAULT NULL COMMENT '留言标题',
  `msg` text NOT NULL COMMENT '留言内容',
  `createtime` datetime NOT NULL COMMENT '留言时间',
  `status` smallint(2) NOT NULL DEFAULT '1' COMMENT '留言状态，1：正常，0：删除',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='留言表';

-- ----------------------------
-- Records of yds_guestbook
-- ----------------------------

-- ----------------------------
-- Table structure for `yds_links`
-- ----------------------------
DROP TABLE IF EXISTS `yds_links`;
CREATE TABLE `yds_links` (
  `link_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `link_url` varchar(255) NOT NULL COMMENT '友情链接地址',
  `link_name` varchar(255) NOT NULL COMMENT '友情链接名称',
  `link_image` varchar(255) DEFAULT NULL COMMENT '友情链接图标',
  `link_target` varchar(25) NOT NULL DEFAULT '_blank' COMMENT '友情链接打开方式',
  `link_description` text NOT NULL COMMENT '友情链接描述',
  `link_status` int(2) NOT NULL DEFAULT '1' COMMENT '状态，1显示，0不显示',
  `link_rating` int(11) NOT NULL DEFAULT '0' COMMENT '友情链接评级',
  `link_rel` varchar(255) DEFAULT NULL COMMENT '链接与网站的关系',
  `listorder` int(10) NOT NULL DEFAULT '0' COMMENT '排序',
  PRIMARY KEY (`link_id`),
  KEY `link_visible` (`link_status`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='友情链接表';

-- ----------------------------
-- Records of yds_links
-- ----------------------------

-- ----------------------------
-- Table structure for `yds_menu`
-- ----------------------------
DROP TABLE IF EXISTS `yds_menu`;
CREATE TABLE `yds_menu` (
  `id` smallint(6) unsigned NOT NULL AUTO_INCREMENT,
  `parentid` smallint(6) unsigned NOT NULL DEFAULT '0',
  `app` varchar(30) NOT NULL DEFAULT '' COMMENT '应用名称app',
  `model` varchar(30) NOT NULL DEFAULT '' COMMENT '控制器',
  `action` varchar(50) NOT NULL DEFAULT '' COMMENT '操作名称',
  `data` varchar(50) NOT NULL DEFAULT '' COMMENT '额外参数',
  `type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '菜单类型  1：权限认证+菜单；0：只作为菜单',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '状态，1显示，0不显示',
  `name` varchar(50) NOT NULL COMMENT '菜单名称',
  `icon` varchar(50) DEFAULT NULL COMMENT '菜单图标',
  `remark` varchar(255) NOT NULL DEFAULT '' COMMENT '备注',
  `listorder` smallint(6) unsigned NOT NULL DEFAULT '0' COMMENT '排序ID',
  PRIMARY KEY (`id`),
  KEY `status` (`status`) USING BTREE,
  KEY `parentid` (`parentid`) USING BTREE,
  KEY `model` (`model`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=301 DEFAULT CHARSET=utf8 COMMENT='后台菜单表';

-- ----------------------------
-- Records of yds_menu
-- ----------------------------

-- ----------------------------
-- Table structure for `yds_nav`
-- ----------------------------
DROP TABLE IF EXISTS `yds_nav`;
CREATE TABLE `yds_nav` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `cid` int(11) NOT NULL COMMENT '导航分类 id',
  `parentid` int(11) NOT NULL COMMENT '导航父 id',
  `label` varchar(255) NOT NULL COMMENT '导航标题',
  `target` varchar(50) DEFAULT NULL COMMENT '打开方式',
  `href` varchar(255) NOT NULL COMMENT '导航链接',
  `icon` varchar(255) NOT NULL COMMENT '导航图标',
  `status` int(2) NOT NULL DEFAULT '1' COMMENT '状态，1显示，0不显示',
  `listorder` int(6) DEFAULT '0' COMMENT '排序',
  `path` varchar(255) NOT NULL DEFAULT '0' COMMENT '层级关系',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='前台导航表';

-- ----------------------------
-- Records of yds_nav
-- ----------------------------

-- ----------------------------
-- Table structure for `yds_nav_cat`
-- ----------------------------
DROP TABLE IF EXISTS `yds_nav_cat`;
CREATE TABLE `yds_nav_cat` (
  `navcid` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL COMMENT '导航分类名',
  `active` int(1) NOT NULL DEFAULT '1' COMMENT '是否为主菜单，1是，0不是',
  `remark` text COMMENT '备注',
  PRIMARY KEY (`navcid`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='前台导航分类表';

-- ----------------------------
-- Records of yds_nav_cat
-- ----------------------------

-- ----------------------------
-- Table structure for `yds_oauth_user`
-- ----------------------------
DROP TABLE IF EXISTS `yds_oauth_user`;
CREATE TABLE `yds_oauth_user` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `from` varchar(20) NOT NULL COMMENT '用户来源key',
  `name` varchar(30) NOT NULL COMMENT '第三方昵称',
  `head_img` varchar(200) NOT NULL COMMENT '头像',
  `uid` int(20) NOT NULL COMMENT '关联的本站用户id',
  `create_time` datetime NOT NULL COMMENT '绑定时间',
  `last_login_time` datetime NOT NULL COMMENT '最后登录时间',
  `last_login_ip` varchar(16) NOT NULL COMMENT '最后登录ip',
  `login_times` int(6) NOT NULL COMMENT '登录次数',
  `status` tinyint(2) NOT NULL,
  `access_token` varchar(512) NOT NULL,
  `expires_date` int(11) NOT NULL COMMENT 'access_token过期时间',
  `openid` varchar(40) NOT NULL COMMENT '第三方用户id',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='第三方用户表';

-- ----------------------------
-- Records of yds_oauth_user
-- ----------------------------

-- ----------------------------
-- Table structure for `yds_options`
-- ----------------------------
DROP TABLE IF EXISTS `yds_options`;
CREATE TABLE `yds_options` (
  `option_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `option_name` varchar(64) NOT NULL COMMENT '配置名',
  `option_value` longtext NOT NULL COMMENT '配置值',
  `autoload` int(2) NOT NULL DEFAULT '1' COMMENT '是否自动加载',
  PRIMARY KEY (`option_id`),
  UNIQUE KEY `option_name` (`option_name`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=10 DEFAULT CHARSET=utf8 COMMENT='全站配置表';

-- ----------------------------
-- Records of yds_options
-- ----------------------------

-- ----------------------------
-- Table structure for `yds_plugins`
-- ----------------------------
DROP TABLE IF EXISTS `yds_plugins`;
CREATE TABLE `yds_plugins` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `name` varchar(50) NOT NULL COMMENT '插件名，英文',
  `title` varchar(50) NOT NULL DEFAULT '' COMMENT '插件名称',
  `description` text COMMENT '插件描述',
  `type` tinyint(2) DEFAULT '0' COMMENT '插件类型, 1:网站；8;微信',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态；1开启；',
  `config` text COMMENT '插件配置',
  `hooks` varchar(255) DEFAULT NULL COMMENT '实现的钩子;以“，”分隔',
  `has_admin` tinyint(2) DEFAULT '0' COMMENT '插件是否有后台管理界面',
  `author` varchar(50) DEFAULT '' COMMENT '插件作者',
  `version` varchar(20) DEFAULT '' COMMENT '插件版本号',
  `createtime` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '插件安装时间',
  `listorder` smallint(6) NOT NULL DEFAULT '0' COMMENT '排序',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='插件表';

-- ----------------------------
-- Records of yds_plugins
-- ----------------------------

-- ----------------------------
-- Table structure for `yds_posts`
-- ----------------------------
DROP TABLE IF EXISTS `yds_posts`;
CREATE TABLE `yds_posts` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `post_author` bigint(20) unsigned DEFAULT '0' COMMENT '发表者id',
  `post_keywords` varchar(150) NOT NULL COMMENT 'seo keywords',
  `post_source` varchar(150) DEFAULT NULL COMMENT '转载文章的来源',
  `post_date` datetime DEFAULT '2000-01-01 00:00:00' COMMENT 'post发布日期',
  `post_content` longtext COMMENT 'post内容',
  `post_title` text COMMENT 'post标题',
  `post_excerpt` text COMMENT 'post摘要',
  `post_status` int(2) DEFAULT '1' COMMENT 'post状态，1已审核，0未审核,3删除',
  `comment_status` int(2) DEFAULT '1' COMMENT '评论状态，1允许，0不允许',
  `post_modified` datetime DEFAULT '2000-01-01 00:00:00' COMMENT 'post更新时间，可在前台修改，显示给用户',
  `post_content_filtered` longtext,
  `post_parent` bigint(20) unsigned DEFAULT '0' COMMENT 'post的父级post id,表示post层级关系',
  `post_type` int(2) DEFAULT '1' COMMENT 'post类型，1文章,2页面',
  `post_mime_type` varchar(100) DEFAULT '',
  `comment_count` bigint(20) DEFAULT '0',
  `smeta` text COMMENT 'post的扩展字段，保存相关扩展属性，如缩略图；格式为json',
  `post_hits` int(11) DEFAULT '0' COMMENT 'post点击数，查看数',
  `post_like` int(11) DEFAULT '0' COMMENT 'post赞数',
  `istop` tinyint(1) NOT NULL DEFAULT '0' COMMENT '置顶 1置顶； 0不置顶',
  `recommended` tinyint(1) NOT NULL DEFAULT '0' COMMENT '推荐 1推荐 0不推荐',
  PRIMARY KEY (`id`),
  KEY `type_status_date` (`post_type`,`post_status`,`post_date`,`id`) USING BTREE,
  KEY `post_parent` (`post_parent`) USING BTREE,
  KEY `post_author` (`post_author`) USING BTREE,
  KEY `post_date` (`post_date`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='Portal文章表';

-- ----------------------------
-- Records of yds_posts
-- ----------------------------

-- ----------------------------
-- Table structure for `yds_reward`
-- ----------------------------
DROP TABLE IF EXISTS `yds_reward`;
CREATE TABLE `yds_reward` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `charge` int(11) NOT NULL,
  `recharge` int(11) NOT NULL,
  `create_time` datetime NOT NULL,
  `grade_id` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of yds_reward
-- ----------------------------

-- ----------------------------
-- Table structure for `yds_role`
-- ----------------------------
DROP TABLE IF EXISTS `yds_role`;
CREATE TABLE `yds_role` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `config_id` int(11) NOT NULL DEFAULT '0',
  `name` varchar(20) NOT NULL COMMENT '角色名称',
  `pid` smallint(6) DEFAULT NULL COMMENT '父角色ID',
  `status` tinyint(1) unsigned DEFAULT NULL COMMENT '状态',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `create_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `update_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  `listorder` int(3) NOT NULL DEFAULT '0' COMMENT '排序字段',
  `only_admin` tinyint(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `parentId` (`pid`) USING BTREE,
  KEY `status` (`status`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=22 DEFAULT CHARSET=utf8 COMMENT='角色表';

-- ----------------------------
-- Records of yds_role
-- ----------------------------

-- ----------------------------
-- Table structure for `yds_role_user`
-- ----------------------------
DROP TABLE IF EXISTS `yds_role_user`;
CREATE TABLE `yds_role_user` (
  `role_id` int(11) unsigned DEFAULT '0' COMMENT '角色 id',
  `user_id` int(11) DEFAULT '0' COMMENT '用户id',
  KEY `group_id` (`role_id`) USING BTREE,
  KEY `user_id` (`user_id`) USING BTREE
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='用户角色对应表';

-- ----------------------------
-- Records of yds_role_user
-- ----------------------------

-- ----------------------------
-- Table structure for `yds_route`
-- ----------------------------
DROP TABLE IF EXISTS `yds_route`;
CREATE TABLE `yds_route` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '路由id',
  `full_url` varchar(255) DEFAULT NULL COMMENT '完整url， 如：portal/list/index?id=1',
  `url` varchar(255) DEFAULT NULL COMMENT '实际显示的url',
  `listorder` int(5) DEFAULT '0' COMMENT '排序，优先级，越小优先级越高',
  `status` tinyint(1) DEFAULT '1' COMMENT '状态，1：启用 ;0：不启用',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='url路由表';

-- ----------------------------
-- Records of yds_route
-- ----------------------------

-- ----------------------------
-- Table structure for `yds_slide`
-- ----------------------------
DROP TABLE IF EXISTS `yds_slide`;
CREATE TABLE `yds_slide` (
  `slide_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `slide_cid` int(11) NOT NULL COMMENT '幻灯片分类 id',
  `slide_name` varchar(255) NOT NULL COMMENT '幻灯片名称',
  `slide_pic` varchar(255) DEFAULT NULL COMMENT '幻灯片图片',
  `slide_url` varchar(255) DEFAULT NULL COMMENT '幻灯片链接',
  `slide_des` varchar(255) DEFAULT NULL COMMENT '幻灯片描述',
  `slide_content` text COMMENT '幻灯片内容',
  `slide_status` int(2) NOT NULL DEFAULT '1' COMMENT '状态，1显示，0不显示',
  `listorder` int(10) DEFAULT '0' COMMENT '排序',
  PRIMARY KEY (`slide_id`),
  KEY `slide_cid` (`slide_cid`) USING BTREE
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='幻灯片表';

-- ----------------------------
-- Records of yds_slide
-- ----------------------------

-- ----------------------------
-- Table structure for `yds_slide_cat`
-- ----------------------------
DROP TABLE IF EXISTS `yds_slide_cat`;
CREATE TABLE `yds_slide_cat` (
  `cid` int(11) NOT NULL AUTO_INCREMENT,
  `cat_name` varchar(255) NOT NULL COMMENT '幻灯片分类',
  `cat_idname` varchar(255) NOT NULL COMMENT '幻灯片分类标识',
  `cat_remark` text COMMENT '分类备注',
  `cat_status` int(2) NOT NULL DEFAULT '1' COMMENT '状态，1显示，0不显示',
  PRIMARY KEY (`cid`),
  KEY `cat_idname` (`cat_idname`) USING BTREE
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='幻灯片分类表';

-- ----------------------------
-- Records of yds_slide_cat
-- ----------------------------

-- ----------------------------
-- Table structure for `yds_station`
-- ----------------------------
DROP TABLE IF EXISTS `yds_station`;
CREATE TABLE `yds_station` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `config_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '连接 wechat_config表的id',
  `name` char(50) NOT NULL DEFAULT '' COMMENT '水站名称',
  `tel` char(15) NOT NULL DEFAULT '' COMMENT '电话',
  `address` char(150) NOT NULL DEFAULT '' COMMENT '地址',
  `gps` char(30) NOT NULL DEFAULT '' COMMENT '地址经纬度',
  `boss_name` char(50) NOT NULL DEFAULT '' COMMENT '老板的名字',
  `boss_wechat_user_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT 'wechat_user  的id',
  `bind_code` char(10) NOT NULL DEFAULT '' COMMENT '绑定码',
  `desc` char(255) NOT NULL DEFAULT '' COMMENT '门店备注',
  `range` text NOT NULL COMMENT '门店服务范围',
  `qr_url` char(255) NOT NULL DEFAULT '' COMMENT '带参数的关注二维码',
  `create_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '创建的时间',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '状态  0--启用 1--禁用 2--删除',
  `grade_id` int(11) NOT NULL COMMENT '代理商id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='水站管理表';

-- ----------------------------
-- Records of yds_station
-- ----------------------------

-- ----------------------------
-- Table structure for `yds_station_deliver`
-- ----------------------------
DROP TABLE IF EXISTS `yds_station_deliver`;
CREATE TABLE `yds_station_deliver` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `config_id` int(11) unsigned NOT NULL DEFAULT '0',
  `openid` char(128) NOT NULL DEFAULT '',
  `name` char(20) NOT NULL DEFAULT '' COMMENT '水工姓名',
  `tel` char(20) NOT NULL DEFAULT '' COMMENT '水工电话',
  `create_time` int(10) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '水工状态，0:未启用，1:启用，2:删除',
  `station_id` int(11) DEFAULT '0' COMMENT '水工所属的水站的id',
  PRIMARY KEY (`id`),
  KEY `config_id_openid_index` (`config_id`,`openid`) USING BTREE,
  KEY `config_id_status_index` (`config_id`,`status`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=34 DEFAULT CHARSET=utf8 COMMENT='水站水工表';

-- ----------------------------
-- Records of yds_station_deliver
-- ----------------------------

-- ----------------------------
-- Table structure for `yds_term_relationships`
-- ----------------------------
DROP TABLE IF EXISTS `yds_term_relationships`;
CREATE TABLE `yds_term_relationships` (
  `tid` bigint(20) NOT NULL AUTO_INCREMENT,
  `object_id` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT 'posts表里文章id',
  `term_id` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '分类id',
  `listorder` int(10) NOT NULL DEFAULT '0' COMMENT '排序',
  `status` int(2) NOT NULL DEFAULT '1' COMMENT '状态，1发布，0不发布',
  PRIMARY KEY (`tid`),
  KEY `term_taxonomy_id` (`term_id`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='Portal 文章分类对应表';

-- ----------------------------
-- Records of yds_term_relationships
-- ----------------------------

-- ----------------------------
-- Table structure for `yds_terms`
-- ----------------------------
DROP TABLE IF EXISTS `yds_terms`;
CREATE TABLE `yds_terms` (
  `term_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '分类id',
  `name` varchar(200) DEFAULT NULL COMMENT '分类名称',
  `slug` varchar(200) DEFAULT '',
  `taxonomy` varchar(32) DEFAULT NULL COMMENT '分类类型',
  `description` longtext COMMENT '分类描述',
  `parent` bigint(20) unsigned DEFAULT '0' COMMENT '分类父id',
  `count` bigint(20) DEFAULT '0' COMMENT '分类文章数',
  `path` varchar(500) DEFAULT NULL COMMENT '分类层级关系路径',
  `seo_title` varchar(500) DEFAULT NULL,
  `seo_keywords` varchar(500) DEFAULT NULL,
  `seo_description` varchar(500) DEFAULT NULL,
  `list_tpl` varchar(50) DEFAULT NULL COMMENT '分类列表模板',
  `one_tpl` varchar(50) DEFAULT NULL COMMENT '分类文章页模板',
  `listorder` int(5) NOT NULL DEFAULT '0' COMMENT '排序',
  `status` int(2) NOT NULL DEFAULT '1' COMMENT '状态，1发布，0不发布',
  PRIMARY KEY (`term_id`)
) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='Portal 文章分类表';

-- ----------------------------
-- Records of yds_terms
-- ----------------------------

-- ----------------------------
-- Table structure for `yds_user_favorites`
-- ----------------------------
DROP TABLE IF EXISTS `yds_user_favorites`;
CREATE TABLE `yds_user_favorites` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` bigint(20) DEFAULT NULL COMMENT '用户 id',
  `title` varchar(255) DEFAULT NULL COMMENT '收藏内容的标题',
  `url` varchar(255) DEFAULT NULL COMMENT '收藏内容的原文地址，不带域名',
  `description` varchar(500) DEFAULT NULL COMMENT '收藏内容的描述',
  `table` varchar(50) DEFAULT NULL COMMENT '收藏实体以前所在表，不带前缀',
  `object_id` int(11) DEFAULT NULL COMMENT '收藏内容原来的主键id',
  `createtime` int(11) DEFAULT NULL COMMENT '收藏时间',
  PRIMARY KEY (`id`),
  KEY `uid` (`uid`) USING BTREE
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='用户收藏表';

-- ----------------------------
-- Records of yds_user_favorites
-- ----------------------------

-- ----------------------------
-- Table structure for `yds_user_goods`
-- ----------------------------
DROP TABLE IF EXISTS `yds_user_goods`;
CREATE TABLE `yds_user_goods` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `config_id` int(11) NOT NULL DEFAULT '0',
  `openid` char(128) NOT NULL DEFAULT '',
  `goods_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户对应另价商品',
  `goods_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '商品新价格',
  `old_goods_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '商品原价',
  `create_time` int(10) NOT NULL DEFAULT '0' COMMENT '创建时间',
  PRIMARY KEY (`id`),
  KEY `index` (`config_id`,`openid`,`goods_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of yds_user_goods
-- ----------------------------

-- ----------------------------
-- Table structure for `yds_users`
-- ----------------------------
DROP TABLE IF EXISTS `yds_users`;
CREATE TABLE `yds_users` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `config_id` int(11) NOT NULL DEFAULT '0',
  `station_id` int(11) NOT NULL DEFAULT '0',
  `user_login` varchar(60) NOT NULL DEFAULT '' COMMENT '用户名',
  `user_pass` varchar(64) NOT NULL DEFAULT '' COMMENT '登录密码；sp_password加密',
  `user_nicename` varchar(50) NOT NULL DEFAULT '' COMMENT '用户美名',
  `user_email` varchar(100) NOT NULL DEFAULT '' COMMENT '登录邮箱',
  `user_url` varchar(100) NOT NULL DEFAULT '' COMMENT '用户个人网站',
  `avatar` varchar(255) DEFAULT NULL COMMENT '用户头像，相对于upload/avatar目录',
  `sex` smallint(1) DEFAULT '0' COMMENT '性别；0：保密，1：男；2：女',
  `birthday` date DEFAULT '2000-01-01' COMMENT '生日',
  `signature` varchar(255) DEFAULT NULL COMMENT '个性签名',
  `last_login_ip` varchar(16) DEFAULT NULL COMMENT '最后登录ip',
  `last_login_time` datetime NOT NULL DEFAULT '2000-01-01 00:00:00' COMMENT '最后登录时间',
  `create_time` datetime NOT NULL DEFAULT '2000-01-01 00:00:00' COMMENT '注册时间',
  `user_activation_key` varchar(60) NOT NULL DEFAULT '' COMMENT '激活码',
  `user_status` int(11) NOT NULL DEFAULT '1' COMMENT '用户状态 0：禁用； 1：正常 ；2：未验证',
  `score` int(11) NOT NULL DEFAULT '0' COMMENT '用户积分',
  `user_type` smallint(1) DEFAULT '1' COMMENT '用户类型，1:admin ;2:会员',
  `coin` int(11) NOT NULL DEFAULT '0' COMMENT '金币',
  `mobile` varchar(20) NOT NULL DEFAULT '' COMMENT '手机号',
  PRIMARY KEY (`id`),
  KEY `user_login_key` (`user_login`) USING BTREE,
  KEY `user_nicename` (`user_nicename`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=25 DEFAULT CHARSET=utf8 COMMENT='用户表';

-- ----------------------------
-- Records of yds_users
-- ----------------------------

-- ----------------------------
-- Table structure for `yds_wechat_access_token`
-- ----------------------------
DROP TABLE IF EXISTS `yds_wechat_access_token`;
CREATE TABLE `yds_wechat_access_token` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '微信access_token',
  `config_id` int(11) NOT NULL DEFAULT '0',
  `token` varchar(255) NOT NULL COMMENT 'token值',
  `expire_time` int(10) NOT NULL COMMENT '过期时间',
  PRIMARY KEY (`id`),
  KEY `config_id_expire_time_index` (`config_id`,`expire_time`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='微信接口access_token表';

-- ----------------------------
-- Records of yds_wechat_access_token
-- ----------------------------

-- ----------------------------
-- Table structure for `yds_wechat_config`
-- ----------------------------
DROP TABLE IF EXISTS `yds_wechat_config`;
CREATE TABLE `yds_wechat_config` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `api_id` char(10) NOT NULL DEFAULT '',
  `public_id` char(60) NOT NULL DEFAULT '',
  `function_prefix` char(10) NOT NULL DEFAULT '',
  `wechat_name` char(30) NOT NULL DEFAULT '',
  `appid` char(30) NOT NULL DEFAULT '',
  `appsecret` char(60) NOT NULL DEFAULT '',
  `mchid` char(30) NOT NULL DEFAULT '',
  `mchsecret` char(60) NOT NULL DEFAULT '',
  `token` char(30) NOT NULL DEFAULT '',
  `tel` char(20) NOT NULL DEFAULT '' COMMENT '商家电话',
  `order_success_tpl_id` char(64) NOT NULL DEFAULT '' COMMENT '送水订单提交成功模板消息ID',
  `order_deliver_tpl_id` char(64) NOT NULL DEFAULT '' COMMENT '商品发货通知模板消息ID',
  `order_finish_tpl_id` char(64) NOT NULL DEFAULT '' COMMENT '订单完成通知模板消息ID',
  `order_push_tpl_id` char(64) NOT NULL DEFAULT '' COMMENT '水工新订单提醒模板消息ID',
  `create_time` int(10) NOT NULL DEFAULT '0',
  `status` tinyint(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of yds_wechat_config
-- ----------------------------

-- ----------------------------
-- Table structure for `yds_wechat_distribution`
-- ----------------------------
DROP TABLE IF EXISTS `yds_wechat_distribution`;
CREATE TABLE `yds_wechat_distribution` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `openid` varchar(64) NOT NULL DEFAULT '',
  `wechat_id` int(10) NOT NULL,
  `recharge` float(11,2) NOT NULL,
  `create_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`,`openid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='分销详细';

-- ----------------------------
-- Records of yds_wechat_distribution
-- ----------------------------

-- ----------------------------
-- Table structure for `yds_wechat_distribution_reply`
-- ----------------------------
DROP TABLE IF EXISTS `yds_wechat_distribution_reply`;
CREATE TABLE `yds_wechat_distribution_reply` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `wechat_id` int(10) NOT NULL,
  `money` float(10,2) DEFAULT NULL,
  `status` tinyint(1) NOT NULL COMMENT '状态0-未审核，1-审核通过，2-审核未通过',
  `create_time` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=64 DEFAULT CHARSET=utf8 COMMENT='微信粉丝提现';

-- ----------------------------
-- Records of yds_wechat_distribution_reply
-- ----------------------------

-- ----------------------------
-- Table structure for `yds_wechat_pay_log`
-- ----------------------------
DROP TABLE IF EXISTS `yds_wechat_pay_log`;
CREATE TABLE `yds_wechat_pay_log` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `wechat_user_id` int(11) NOT NULL DEFAULT '0' COMMENT '微信粉丝ID',
  `openid` char(60) NOT NULL DEFAULT '',
  `order_id` int(11) NOT NULL DEFAULT '0' COMMENT '水票id，json格式存储',
  `out_trade_no` char(40) NOT NULL DEFAULT '' COMMENT '微信支付订单号',
  `transaction_id` char(60) NOT NULL DEFAULT '',
  `price` int(11) NOT NULL DEFAULT '0' COMMENT '水票总价',
  `pay_price` int(11) NOT NULL DEFAULT '0',
  `create_time` int(10) NOT NULL DEFAULT '0' COMMENT '订单状态产生时间',
  `pay_time` int(10) NOT NULL DEFAULT '0',
  `notify_data` text,
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否支付，0:发起支付，1:支付成功，2:取消支付，3:支付失败',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='微信支付日志';

-- ----------------------------
-- Records of yds_wechat_pay_log
-- ----------------------------

-- ----------------------------
-- Table structure for `yds_wechat_user`
-- ----------------------------
DROP TABLE IF EXISTS `yds_wechat_user`;
CREATE TABLE `yds_wechat_user` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `config_id` int(11) NOT NULL DEFAULT '0' COMMENT '但萨的',
  `station_id` int(11) NOT NULL DEFAULT '0',
  `deeps` int(10) NOT NULL DEFAULT '1' COMMENT '用户分销深度',
  `path` char(255) NOT NULL DEFAULT '0-' COMMENT '用户分销路径',
  `qr_code` char(255) NOT NULL DEFAULT '' COMMENT '分销二维码',
  `subscribe` tinyint(1) NOT NULL DEFAULT '0' COMMENT '用户是否订阅该公众号标识0:未关注1:关注',
  `openid` varchar(255) NOT NULL DEFAULT '' COMMENT ' 	用户的标识，对当前公众号唯一 openid',
  `nickname` varchar(255) NOT NULL DEFAULT '' COMMENT '用户昵称',
  `sex` enum('0','1','2') NOT NULL DEFAULT '0' COMMENT '用户的性别，值为1时是男性，值为2时是女性，值为0时是未知 ',
  `language` varchar(20) NOT NULL DEFAULT 'zh_CN' COMMENT '用户语言中文zh-cn',
  `city` varchar(50) NOT NULL DEFAULT '' COMMENT '用户所在城市',
  `province` varchar(50) NOT NULL DEFAULT '' COMMENT '用户所在省份',
  `country` varchar(50) NOT NULL DEFAULT '' COMMENT '用户所在国家',
  `headimgurl` varchar(200) NOT NULL DEFAULT '' COMMENT ' headimgurl 	用户头像，最后一个数值代表正方形头像大小（有0、46、64、96、132数值可选，0代表640*640正方形头像），用户没有头像时该项为空。若用户更换头像，原有头像URL将失效',
  `subscribe_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '用户关注时间，为时间戳。如果用户曾多次关注，则取最后关注时间 ',
  `unionid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '只有在用户将公众号绑定到微信开放平台帐号后，才会出现该字段',
  `remark` text COMMENT '公众号运营者对粉丝的备注，公众号运营者可在微信公众平台用户管理界面对粉丝添加备注 ',
  `groupid` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '用户所在的分组ID',
  `tagid_list` text,
  `bucket` int(11) NOT NULL DEFAULT '0' COMMENT '用户压桶数量',
  `is_boss` tinyint(1) DEFAULT '0' COMMENT '是否是老板 0 不是 1 是老板',
  `parent_id` int(11) DEFAULT '0',
  `balance` decimal(22,2) NOT NULL DEFAULT '0.00',
  `create_time` int(10) DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`),
  KEY `openid_index` (`openid`) USING BTREE,
  KEY `config_id_index` (`config_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='微信用户信息表';

-- ----------------------------
-- Records of yds_wechat_user
-- ----------------------------

-- ----------------------------
-- Table structure for `yds_wechat_user_address`
-- ----------------------------
DROP TABLE IF EXISTS `yds_wechat_user_address`;
CREATE TABLE `yds_wechat_user_address` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '微信用户收货地址表id ',
  `config_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '所属服务号',
  `station_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户地址所属水站',
  `openid` char(128) NOT NULL DEFAULT '' COMMENT '所属人openid',
  `alias` char(30) NOT NULL DEFAULT '' COMMENT '收获地址别名',
  `name` char(30) NOT NULL DEFAULT '' COMMENT '收货人',
  `tel` char(20) NOT NULL DEFAULT '' COMMENT '收货人电话',
  `pcd` char(90) NOT NULL DEFAULT '' COMMENT 'province-city-distinct，省市区',
  `detail` char(90) NOT NULL DEFAULT '' COMMENT '详细地址信息',
  `gps` char(20) NOT NULL DEFAULT '' COMMENT 'lat,lon，GPS信息',
  `create_time` int(10) NOT NULL DEFAULT '0',
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '收获地址状态，0:可用，1:默认，2:删除',
  PRIMARY KEY (`id`),
  KEY `config_id_index` (`config_id`) USING BTREE,
  KEY `openid_index` (`openid`) USING BTREE,
  KEY `config_id_openid_status_index` (`config_id`,`openid`,`status`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='微信用户收货地址表';

-- ----------------------------
-- Records of yds_wechat_user_address
-- ----------------------------

-- ----------------------------
-- Table structure for `yds_wechat_user_msg`
-- ----------------------------
DROP TABLE IF EXISTS `yds_wechat_user_msg`;
CREATE TABLE `yds_wechat_user_msg` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '微信用户发送消息表',
  `config_id` int(11) NOT NULL DEFAULT '0' COMMENT '所属服务号',
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '粉丝ID',
  `nickname` varchar(40) NOT NULL DEFAULT '' COMMENT '粉丝昵称，base64_encode值',
  `msg` text COMMENT '用户发送的消息',
  `response` text COMMENT '回复的内容',
  `create_time` char(19) NOT NULL DEFAULT '0' COMMENT '发送消息的时间',
  PRIMARY KEY (`id`),
  KEY `user_id_index` (`user_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='微信粉丝消息表';

-- ----------------------------
-- Records of yds_wechat_user_msg
-- ----------------------------

-- ----------------------------
-- Table structure for `yds_wechat_user_point`
-- ----------------------------
DROP TABLE IF EXISTS `yds_wechat_user_point`;
CREATE TABLE `yds_wechat_user_point` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `config_id` int(11) NOT NULL DEFAULT '0',
  `openid` char(128) NOT NULL DEFAULT '',
  `address` char(255) NOT NULL DEFAULT '' COMMENT '用户地理位置',
  `gps` char(32) NOT NULL DEFAULT '' COMMENT '用户gps',
  `create_time` int(10) NOT NULL DEFAULT '0' COMMENT '地址更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of yds_wechat_user_point
-- ----------------------------

-- ----------------------------
-- Table structure for `yds_wechat_user_ticket`
-- ----------------------------
DROP TABLE IF EXISTS `yds_wechat_user_ticket`;
CREATE TABLE `yds_wechat_user_ticket` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `config_id` int(11) NOT NULL,
  `openid` char(128) NOT NULL DEFAULT '''''',
  `goods_id` int(11) NOT NULL DEFAULT '0' COMMENT '水票对应商品的id',
  `createtime` int(10) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `goods_name` char(60) NOT NULL DEFAULT '''''' COMMENT '商品名称',
  `goods_img` varchar(1000) NOT NULL DEFAULT '''''' COMMENT '商品图片',
  `goods_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '商品单价',
  `price` decimal(10,2) NOT NULL COMMENT '水票总价',
  `name` char(60) NOT NULL COMMENT '水票名称',
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0未支付1未使用2已使用3购买支付锁定中4使用锁定中',
  `strategy_id` int(11) NOT NULL DEFAULT '0' COMMENT '水票id',
  `order_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户水票对应订单id',
  `user_order_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户支付订单id',
  `start_time` int(10) NOT NULL DEFAULT '0' COMMENT '活动开始时间',
  `end_time` int(10) NOT NULL DEFAULT '2000000000' COMMENT '活动结束时间',
  `condition` char(128) NOT NULL DEFAULT '' COMMENT '水票使用条件',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of yds_wechat_user_ticket
-- ----------------------------
